    /* Base64 encoded audio bytes generated by the model, in the format specified in the request.  */
    _data: String,
    /* Transcript of the audio generated by the model. */
    _transcript: String
)
object ChatCompletionResponseMessageAudio {
    def toStringBody(var_id: Object, var_expiresAt: Object, var_data: Object, var_transcript: Object) =
        s"""
        | {
        | "id":$var_id,"expiresAt":$var_expiresAt,"data":$var_data,"transcript":$var_transcript
        | }
        """.stripMargin
}
